import { element } from "prop-types";
import React from "react";
import Header from './Components/Header';
import Products from './Components/Products';


class App extends React.Component {
  render(){
    var titles=[
      {
        id:1,
        name:'Home',
        status: true
      },
      {
        id: 2,
        name:'Category',
        status:true
      },
      {
        id:3,
        name:'Contact',
        status:true
      },
      {
        id: 4,
        name:'More',
        status: true
      }
    ];
    let elementTitle= titles.map((title,index)=>{
        let result="";
        if(title.status){
          result=<Header key ={title.id} name={title.name}/>
        }
        return result
    });
    return (
      <div>
        <Header/>
        <div>{elementTitle}</div>
        <div className="row">
            <div className="col-xs- col-sm- col-md- col-lg-">
            <Products/>
            </div>
            <div className="col-xs- col-sm- col-md- col-lg-">
            <Products/>
          </div>
        </div>

      </div>

    );

  }

}

export default App;
